import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Login from './components/Auth/Login';
import Register from './components/Auth/Register';
import Home from './components/Home/Home';
import ProductList from './components/Products/ProductList';
import ProductDetail from './components/Products/ProductDetail';
import AdminDashboard from './components/Products/AdminDashboard';
import Cart from './components/Cart/Cart';
import Checkout from './components/Cart/Checkout';
import { AuthProvider } from './context/AuthContext';
import { CartProvider } from './context/CartContext';
import ProtectedRoute from './components/ProtectedRoute';

const App = () => {
  return (
    <Router>
      <AuthProvider>
        <CartProvider>
          <Routes>
            <Route path="/login" element={<Login />} />
            <ProtectedRoute path="/register" element={<Register />} />
            <ProtectedRoute path="/products" element={<ProductList />} />
            <ProtectedRoute path="/products/:id" element={<ProductDetail />} />
            <ProtectedRoute path="/admin" element={<AdminDashboard />} />
            <ProtectedRoute path="/cart" element={<Cart />} />
            <ProtectedRoute path="/checkout" element={<Checkout />} />
            <ProtectedRoute path="/" element={<Home />} />
          </Routes>
        </CartProvider>
      </AuthProvider>
    </Router>
  );
};

export default App;
